;function statHalfDonut(t,e){nv.addGraph(function(){var a=400,r=380,n=nv.models.pieChart().x(function(t){return t.key}).showLabels(!1).width(a).height(r).donut(!0);n.pie.startAngle(function(t){return t.startAngle/2-Math.PI/2}).endAngle(function(t){return t.endAngle/2-Math.PI/2});n.legend.maxKeyLength(200);d3.select('#'+t).datum(JSON.parse(e)).transition().duration(1200).attr('width',a).attr('height',r).call(n);return n})};function statBar(t,e,n){nv.addGraph(function(){var r=400,i=380,a=nv.models.discreteBarChart().x(function(t){return t.label}).y(function(t){return t.value}).width(r).height(i).staggerLabels(!0).showValues(!1);d3.select('#'+t).datum([JSON.parse(e)]).attr('width',r).attr('height',i).call(a);d3.select('#'+t).append('text').attr('x',200).attr('y',12).attr('text-anchor','middle').style('font-weight','bold').text(n);nv.utils.windowResize(a.update);return a})};